                                        id="localidad_destino" name="localidad_destino">
                                        <option value="">Por favor seleccione</option>
                                        {existeLocalidad ? listaLocalidades() : null}
                                    </Field>
                                </div>
                            </div>


                            {/* 19. NOMBRE ENTIDAD*/}
                            <div className="col-md-5">
                                <div className="form-group">
                                    <label htmlFor="entidad_origen">Nombre Entidad</label>
                                    <Field value={item.attributes.nombreEntidad} as="input" type="text" autoComplete="off" className="form-control"
                                        id="entidad_origen" name="entidad_origen" disabled={true}></Field>
                                </div>
                            </div>

                            <div className="col-md-2">
                                <div className="form-group">
                                    <Center>
                                        <button type="button" className="btn btn-success" onClick={event => handleClick(event, 19)}>
                                            <i class="fas fa-angle-double-right"></i></button>
                                    </Center>
                                </div>
                            </div>

                            <div className="col-md-5">
                                <div className="form-group">
                                    <label htmlFor="entidad_destino">Nombre Entidad</label>
                                    <Field value={nombreEntidad} as="input" type="text" autoComplete="off" className="form-control"
                                        id="entidad_destino" name="entidad_destino"
                                        onChange={event => handleInputChange(event, 19)}></Field>
                                </div>
                            </div>

                            {/* 20. SECTOR ENTIDAD*/}
                            <div className="col-md-5">
                                <div className="form-group">
                                    <label htmlFor="sector_origen">Sector Entidad</label>
                                    <Field value={item.attributes.sectorEntidad} as="input" type="text" autoComplete="off" className="form-control"
                                        id="sector_origen" name="sector_origen" disabled={true}></Field>
                                </div>
                            </div>

                            <div className="col-md-2">
                                <div className="form-group">
                                    <Center>
                                        <button type="button" className="btn btn-success" onClick={event => handleClick(event, 20)}>
                                            <i class="fas fa-angle-double-right"></i></button>
                                    </Center>
                                </div>
                            </div>

                            <div className="col-md-5">
                                <div className="form-group">
                                    <label htmlFor="sector_destino">Sector Entidad</label>
                                    <Field value={sectorEntidad} as="input" type="text" autoComplete="off" className="form-control"
                                        id="sector_destino" name="sector_destino"
                                        onChange={event => handleInputChange(event, 20)}></Field>
                                </div>
                            </div>

                        </>
                    )
                })
            )
        }
    }

    const enviarDatos = (datos) => {
        window.showSpinner(true);
        let data;

        data = {
            "data": {
                "type": 'migracion-datos-interesado',
                "attributes": {
                    "tipo_interesado": datos.tipo_interesado,
                    "tipo_sujeto_procesal": datos.tipo_sujeto_procesal,
                    "primer_nombre": datos.primer_nombre,
                    "segundo_nombre": datos.segundo_nombre,
                    "primer_apellido": datos.primer_apellido,
                    "segundo_apellido": datos.segundo_apellido,
                    "tipo_documento": datos.tipo_documento,
                    "numero_documento": datos.numero_documento,
                    "email": datos.email,
                    "telefono": datos.telefono,
                    "telefono2": datos.telefono2,
                    "cargo": datos.cargo,
                    "orientacion_sexual": datos.orientacion_sexual,
                    "sexo": datos.sexo,
                    "direccion": datos.direccion,
                    "departamento": datos.departamento,
                    "ciudad": datos.ciudad,
                    "localidad": datos.localidad,
                    "entidad": datos.entidad,
                    "sector": datos.sector,
                    "radicado": radicado,
                    "vigencia": vigencia,
                    "item": item,
                }
            }
        }

        GenericApi.addGeneric("migrar-interesados", data).then(
            datos => {
                if (!datos.error) {
                    setModalState({ title: "SINPROC No " + props.getParametros.radicado + " :: Crear interesado", message: 'Registro Exitoso', show: true, redirect: `/ProcesoDisciplinarioMigracion/${props.getParametros.radicado}/${props.getParametros.vigencia}`, alert: global.Constants.TIPO_ALERTA.EXITO });
                }
                else {
                    setModalState({ title: "SINPROC No " + props.getParametros.radicado + " :: Crear interesado", message: datos.error.toString(), show: true, redirect: `/ProcesoDisciplinarioMigracion/${props.getParametros.radicado}/${props.getParametros.vigencia}`, alert: global.Constants.TIPO_ALERTA.ERROR });
                }
                window.showSpinner(false);

            }
        )
    }

    return (
        <>
            {<Spinner />}
            {<ModalGen data={getModalState} />}

            <Formik
                initialValues={{
                    tipo_interesado: tipoInteresado,
                    tipo_sujeto_procesal: tipoSujetoProcesal,
                    primer_nombre: primerNombre,
                    segundo_nombre: segundoNombre,
                    primer_apellido: primerApellido,
                    segundo_apellido: segundoApellido,
                    tipo_documento: tipoDocumento,
                    numero_documento: numeroDocumento,
                    email: email,
                    telefono: telefono,
                    telefono2: telefono2,
                    cargo: profesion,
                    orientacion_sexual: idOrientacionSexual,
                    sexo: idSexo,
                    direccion: direccion,
                    departamento: departamento,
                    ciudad: ciudad,
                    localidad: localidad,
                    entidad: nombreEntidad,
                    sector: sectorEntidad,
                }}
                enableReinitialize
                validate={(valores) => {
                    let errores = {}

                    return errores
                }}
                onSubmit={(valores, { resetForm }) => {
                    enviarDatos(valores);
                }}
            >

                {({ errors }) => (
                    <Form>

                        <div className="w2d_block">
                            <nav aria-label="breadcrumb">
                                <ol className="breadcrumb breadcrumb-alt push">
                                    <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                                    <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ProcesoDisciplinarioMigracion/${props.getParametros.radicado}/${props.getParametros.vigencia}`}><small>Inicio proceso de migracin</small></Link></li>
                                    <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ListarMigracionInteresados/${props.getParametros.radicado}/${props.getParametros.vigencia}`}><small>Lista de interesados</small></Link></li>
                                    <li class="breadcrumb-item"> <small>Datos del interesado</small></li>
                                </ol>
                            </nav>
                        </div>


                        <div className="block block-themed">
                            <div className="block-header">
                                <h3 className="block-title">Proceso disciplinario :: {radicado} - {vigencia} - Item No {item + 1}</h3>
                            </div>

                            <div className="block-content">

                                <div className='text-right'>

                                    <Link to={`/AntecedentesLista/`} title='Regresar a lista de Antecedentes' >
                                        <button type="button" className="btn btn-success"><i className="fas fa-backward"></i> </button>
                                    </Link>
                                </div>

                                <div className="row">

                                    {infoInteresado()}

                                </div>

                            </div>
                            <div className="block-content block-content-full text-right bg-light">
                                <button type="submit" className="btn btn-rounded btn-primary">Registrar</button>

                                <Link to={`/AntecedentesLista/`}>
                                    <button type="button" className="btn btn-rounded btn-outline-primary">Cancelar</button>
                                </Link>
                            </div>
                        </div>
                    </Form>
                )}
            </Formik>
        </>
    );
}


export default ComponenteMDatosInteresado;
